class Solution {
public:
    vector<string> cellsInRange(string s) {
        char st=s[0];
        char en=s[3];

        int srt=s[1]-'0';
        int end=s[4]-'0';
        // cout<<srt<<" "<<end;
        vector<string> ans;
        for(char k=st;k<=en;k++){
            for(int i=srt;i<=end;i++){

                string p=k+to_string(i);
                // cout<<i<<endl;
                ans.push_back(p);
            }
        }
        return ans;
    }
};
